export default class User extends Component {
  // 类组件的props是存储到类的实例对象中
  // 可以直接通过实例对象访问
  // this.props
  render() {
    return (
      <ul>
        <li>姓名:孙悟空</li>
        <li>年龄:18</li>
        <li>性别:男</li>
      </ul>
    )
  }
}
